INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (0, "", 1, 0, 0, "", 91002, 100, 8, 36, 40000);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "ぺコリーヌ", 1, 0, 107501, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 150, 8, 37, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "コッコロ", 2, 0, 107601, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 150, 8, 38, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "キャル", 3, 0, 107801, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 150, 8, 39, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "スズメ", 4, 0, 107701, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 150, 8, 40, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "タマキ", 5, 0, 107901, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 150, 8, 41, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "ぺコリーヌ", 6, 0, 107501, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 150, 8, 42, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "コッコロ", 7, 0, 107601, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 150, 8, 43, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "キャル", 8, 0, 107801, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 150, 8, 44, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "スズメ", 9, 0, 107701, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 150, 8, 45, 40001);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "タマキ", 10, 0, 107901, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 150, 8, 46, 40001);
