INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "リリ", 1, 0, 125801, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 1, 2, 321, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "クリア", 2, 0, 126001, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 1, 2, 322, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (1, "プレシア", 3, 0, 126101, "んーと。\nこれ、あげる。\nはい", 24001, 1, 2, 323, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "リリ", 4, 0, 125801, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 1, 2, 324, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "クリア", 5, 0, 126001, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 1, 2, 325, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (2, "プレシア", 6, 0, 126101, "お兄。\nきてくれて、うれしい", 24001, 1, 2, 326, 40011);
